#include <SDL2/SDL.h>
#include <SDL2/SDL_image.h>
#include <stdio.h>

int main() {
    // Inizializza SDL
    if (SDL_Init(SDL_INIT_VIDEO) != 0) {
        fprintf(stderr, "Errore durante l'inizializzazione di SDL: %s\n", SDL_GetError());
        return 1;
    }

    // Crea una finestra
    SDL_Window* window = SDL_CreateWindow("Visualizzatore Immagine", SDL_WINDOWPOS_UNDEFINED, SDL_WINDOWPOS_UNDEFINED, 640, 480, SDL_WINDOW_SHOWN);
    if (window == NULL) {
        fprintf(stderr, "Errore durante la creazione della finestra: %s\n", SDL_GetError());
        SDL_Quit();
        return 1;
    }

    // Crea un renderer per la finestra
    SDL_Renderer* renderer = SDL_CreateRenderer(window, -1, SDL_RENDERER_ACCELERATED | SDL_RENDERER_PRESENTVSYNC);
    if (renderer == NULL) {
        fprintf(stderr, "Errore durante la creazione del renderer: %s\n", SDL_GetError());
        SDL_DestroyWindow(window);
        SDL_Quit();
        return 1;
    }

    // Carica l'immagine da visualizzare
    SDL_Surface* surface = IMG_Load("molang.jfif");
    if (surface == NULL) {
        fprintf(stderr, "Errore durante il caricamento dell'immagine: %s\n", IMG_GetError());
        SDL_DestroyRenderer(renderer);
        SDL_DestroyWindow(window);
        SDL_Quit();
        return 1;
    }

    // Converti la superficie in una texture
    SDL_Texture* texture = SDL_CreateTextureFromSurface(renderer, surface);
    SDL_FreeSurface(surface);
    if (texture == NULL) {
        fprintf(stderr, "Errore durante la creazione della texture: %s\n", SDL_GetError());
        SDL_DestroyRenderer(renderer);
        SDL_DestroyWindow(window);
        SDL_Quit();
        return 1;
    }

    // Pulisci lo schermo
    SDL_RenderClear(renderer);

    // Disegna la texture
    SDL_RenderCopy(renderer, texture, NULL, NULL);

    // Aggiorna la finestra
    SDL_RenderPresent(renderer);

    // Loop per mantenere aperta la finestra finché non viene chiusa dall'utente
    int quit = 0;
    SDL_Event event;
    while (!quit) {
        while (SDL_PollEvent(&event)) {
            if (event.type == SDL_QUIT) {
                quit = 1;
            }
        }
    }

    // Libera le risorse e chiudi SDL
    SDL_DestroyTexture(texture);
    SDL_DestroyRenderer(renderer);
    SDL_DestroyWindow(window);
    SDL_Quit();

    return 0;
}

